INSERT [dbo].[form_fields] ([ID], [Label], [Text], [FieldType], [IsRequired], [MaxChars], [HoverText], [Hint], [SubLabel], [Size], [SelectedOption], [Columns], [Rows], [Options], [Validation], [DomId], [Order], [MinimumAge], [MaximumAge], [HelpText], [DateAdded], [MaxFilesizeInKb], [ValidFileExtensions], [MinFilesizeInKb], [ImageBase64], [AddOthersOption], [OthersOption], [MatrixRow], [MatrixColumn]) VALUES (92, N'<p><b>Follow Up</b></p><p>In the event of any abnormal test result, I understand that I will be contacted for follow-up usingmy contact details provided herein and that I should see a doctor if any of my test results are abnormal. I also understand that there are limitations to the screening tests and that they are not conclusive in detecting or ruling out medical risk factors or conditions. I should seek medicaladvice if I feel unwell or have any symptoms even if the test results are normal.</p><p>Depending on my test results, I may be contacted and/or referred for post-screening follow-upunder one or more of the Organisers’ screening partner service providers. I may also be referred,where appropriate, to participate in community programmes/activities organised by the HealthPromotionBoard, PA, Voluntary Welfare Organisations, constituency managers, service providersor grassroots organisations for follow-up or participation in community programmes/activities. Iunderstand that the decision to participate in the above-mentioned activities is entirely mine.</p>', N'Click to edit', N'RADIOBUTTON', 0, 50, N'', N'', N'', N'', N'option1', 20, 20, N'Yes participant consents to the above.', N'', 17, 16, 18, 100, N'', CAST(N'2017-03-05 08:32:57.497' AS DateTime), 5000, N'.jpg,.png,.gif,.pdf,.bmp,.zip', 10, N'', 0, NULL, N'', N'')
GO
INSERT [dbo].[form_fields] ([ID], [Label], [Text], [FieldType], [IsRequired], [MaxChars], [HoverText], [Hint], [SubLabel], [Size], [SelectedOption], [Columns], [Rows], [Options], [Validation], [DomId], [Order], [MinimumAge], [MaximumAge], [HelpText], [DateAdded], [MaxFilesizeInKb], [ValidFileExtensions], [MinFilesizeInKb], [ImageBase64], [AddOthersOption], [OthersOption], [MatrixRow], [MatrixColumn]) VALUES (93, N'<p><b>Introduction </b><br></p><p>This is a public health screening event jointly organised by National University Health System(NUHS),People’s Association (PA), and the medical students of National University of Singapore(NUS) Yong Loo Lin School of Medicine (YLLSoM) (collectively the “Organisers”)</p><p><b>Consent to Screen</b></p><p>I consent to undergo health screening tests for one or more of the following: obesity, high bloodpressure, fasting venous blood test for diabetes and dyslipidemia, cancers (specifically breastand cervical cancer screening registration for females, colorectal cancer screening for bothgenders) and additional screening modalities (geriatrics and oral health). I understand that all mypersonal data and information will be recorded and stored in a secure and confidential manner bythe Organisers.</p><p><b>Declaration</b></p><p>I am eligible for the health screening tests offered to me. I hereby declare that all the informationIam providing is true to the best of my knowledge.</p><p><b>Collection and Use of Information<sup>[1]</sup></b></p><p>I acknowledge that my personal data and relevant screening and follow-up information, includingthe test results, will be collected and used by the Organisers for the purposes of conducting thetests and managing and implementing follow-up action arising from the test results. I alsoacknowledge that the information will be retained by PHS, NUHS, Health Promotion Board (HPB), Singapore Cancer Society (SCS), the National e-Health Records (NEHR) and the Ministry ofHealth (MOH), and that aggregate/de-identified Information may be used for research, statisticaland planning purposes.</p><p><b>Authorisation</b></p><p>I authorise the Organisers to approach other healthcare institutions/clinics which are in thepossession of my screening, follow-up, further assessment and/or treatment records to requestfor such relevant records (if any) for the purposes of patient care, treatment or clinical /programme review.</p><p><b>Disclosure of Information</b></p><p>I agree and consent to the Organisers and the healthcare organisation(s) administering the teststo disclose:</p><blockquote><p>a. My information, past screening and follow-up information to the Organisers’ authorisedpartners which may include public healthcare institutions and their affiliatedagencies,hospitals, polyclinics, doctors, laboratories, Singapore Cancer Society andother related healthcare providers; and,</p><p>b. My past screening results and follow-up information to/from the authorised partners forthe purposes of checking if I require re-screening, further tests, follow-up action and/orreferral to community programmes/activities. <br></p></blockquote><p>[1] Including data collected underBreastScreen Singapore, CervicalScreen Singapore, National Colorectal CancerScreening Programme,HPB’s Integrated Screening Programme, Community FunctionalScreening Programme and other screening programmes conducted by HPB and itsauthorised partners.[1] Including data collected under BreastScreen Singapore, CervicalScreen Singapore, NationalColorectal Cancer Screening Programme,HPB’s Integrated Screening Programme, CommunityFunctional Screening Programme and other screening programmes conducted by HPB and itsauthorised partners.</p>', N'Click to edit', N'RADIOBUTTON', 0, 50, N'', N'', N'', N'', N'option1', 20, 20, N'Yes participant consents to the above.', N'', 18, 15, 18, 100, N'', CAST(N'2017-03-05 08:43:27.550' AS DateTime), 5000, N'.jpg,.png,.gif,.pdf,.bmp,.zip', 10, N'', 0, NULL, N'', N'')
GO
INSERT [dbo].[form_fields] ([ID], [Label], [Text], [FieldType], [IsRequired], [MaxChars], [HoverText], [Hint], [SubLabel], [Size], [SelectedOption], [Columns], [Rows], [Options], [Validation], [DomId], [Order], [MinimumAge], [MaximumAge], [HelpText], [DateAdded], [MaxFilesizeInKb], [ValidFileExtensions], [MinFilesizeInKb], [ImageBase64], [AddOthersOption], [OthersOption], [MatrixRow], [MatrixColumn]) VALUES (94, N'<p><b>Follow Up</b><br></p><p>I understand that I may be contacted regardless of my results for administrative reasons, but suchcommunications will only be made when absolutely necessary. I also understand that I will receive periodic SMS updates with health tips and advice on healthy living, as well as remindersto visit my primary care doctor for follow-up care.</p>', N'Click to edit', N'RADIOBUTTON', 0, 50, N'', N'', N'', N'', N'option1', 20, 20, N'Participant consents to receiving periodic SMS updates with health tips and advice on healthy living as well as reminders to visit my primary care doctor for follow-up care.', N'', 19, 17, 18, 100, N'', CAST(N'2017-03-05 08:44:57.480' AS DateTime), 5000, N'.jpg,.png,.gif,.pdf,.bmp,.zip', 10, N'', 0, NULL, N'', N'')
GO
INSERT [dbo].[form_fields] ([ID], [Label], [Text], [FieldType], [IsRequired], [MaxChars], [HoverText], [Hint], [SubLabel], [Size], [SelectedOption], [Columns], [Rows], [Options], [Validation], [DomId], [Order], [MinimumAge], [MaximumAge], [HelpText], [DateAdded], [MaxFilesizeInKb], [ValidFileExtensions], [MinFilesizeInKb], [ImageBase64], [AddOthersOption], [OthersOption], [MatrixRow], [MatrixColumn]) VALUES (103, N'<p><b>Compliance to Personal Data Protection Act (PDPA)</b></p><p>I hereby give my consent to the Public Health Service Executive Committee 
to collect my personal information for the purpose of recruitment for 
the Public Health Service (hereby called “PHS”) and its related events, 
and to contact me via calls, SMS, text messages or<br>emails regarding 
the event and follow-up process. Should you wish to withdraw your 
consent for us to contact you for the purposes stated above, please 
notify a member of the PHS Executive Committee at ask.phs@gmail.com in 
writing. We will then remove your personal information from our 
database. Please allow 3 business days for your withdrawal of consent to
 take effect. All personal information will be kept confidential, will 
only be disseminated to members of the PHS Executive Committee, and will
 be strictly used by these parties for the purposes stated.<b><br></b></p>', N'Click to edit', N'RADIOBUTTON', 0, 50, N'', N'', N'', N'', N'option1', 20, 20, N'Yes', N'', 20, 18, 18, 100, N'', CAST(N'2017-03-06 12:10:28.377' AS DateTime), 5000, N'.jpg,.png,.gif,.pdf,.bmp,.zip', 10, N'', 0, NULL, N'', N'')
GO
