Kindly advise the participant to see a GP/polyclinic instead if he/she is expecting
treatment for their problems.</p><p>Refer to Dr''s consult if worrying / patient strongly insists. Indicate on Page 2 of<br>Form A.<br></p>', N'Click to edit', N'TEXTAREA', 0, 50, N'', N'', N'', N'', N'option1', 20, 20, N'option1,option2', N'', 1, 0, 18, 100, N'', CAST(N'2017-03-08 13:46:50.953' AS DateTime), 5000, N'.jpg,.png,.gif,.pdf,.bmp,.zip', 10, N'', 0, NULL, N'', N'')
